    """
    n, *arr = [int(x) for x in stdin.split()]

    # If there is only one person, then only one point of stamina is needed.
    if n == 1:
        return str(0)

    # Sort the list in ascending order to the find the minimum points of stamina.
    arr.sort()

    # Calculate the minimum points of stamina for the first person.
    points = 0
    for i in range(1, n):
