from collections import Counter

class Board:
    def __init__(self, H, W):
        self.H = H
        self.W = W
        self.board = [['.'] * W for _ in range(H)]
        self.black = set()
        self.white = set()

    def read_board(self, stdin):
        for i in range(self.H):
            row = stdin.readline().strip()
            for j, col in enumerate(row):
                self.board[i][j] = col

    def can_color(self, i, j, color):
        for x, y in [(-1, 1), (0, 1), (1, 1), (-1, 0), (1, 0)]:
            if i + x >= 0 and i + x <= self.H-1 and j + y >= 0 and j + y <= self.W - 1 and self.board[i+x][j+y] == color:
                return False
        return True

    def color(self, i, j, color):
        for x, y in [(-1, 1), (0, 1), (1, 1), (-1, 0), (1, 0)]:
            if i + x >= 0 and i + x <= self.H-1 and j + y >= 0 and j + y <= self.W - 1 and self.board[i+x][j+y] == '.':
                self.board[i+x][j+y] = color
                self.black.add((i+x, j+y)) if color == '#' else self.white.add((i+x, j+y))

    def paint_once(self, color):
        for i in range(self.H):
            for j in range(self.W):
                if self.board[i][j] == color:
                    self.color(i, j, color)

    def count_black(self):
        return len(self.black)

    def count_white(self):
        return len(self.white)

    def print_board(self):
        for row in self.board:
            print(''.join(row))

    def check_if_done(self):
        return self.count_black() == self.H * self.W or self.count_white() == self.H * self.W

