    # Initialize the maze.
    maze: List[List[str]] = []
    for _ in range(int(stdin[0])):
        maze.append(list(stdin[1 + _]))
    # Get the starting position.
    start_x = 0
    start_y = 0
    for x in range(len(maze)):
        for y in range(len(maze[x])):
            if maze[x][y] == "S":
                start_x = x
                start_y = y
                break
        if start_x!= 0:
            break
    # Check if the starting position is a valid position.
    if maze[start_x][start_y] == "1":
        return "NOT POSSIBLE"
    # Determine if the maze is blocked from the right.
    if maze[start_x][start_y] == "L":
        maze[start_x][start_y] = "1"
    # Determine if the maze is blocked from the left.
    if maze[start_x][start_y] == "R":
        maze[start_x][start_y] = "1"
    # Determine if the maze is blocked from the up.
    if maze[start_x][start_y] == "U":
        maze[start_x][start_y] = "1"
    # Determine if the maze is blocked from the down.
    if maze[start_x][start_y] == "D":
        maze[start_x][start_y] = "1"
    # Perform DFS to find the shortest path.
    stack: List[List[int]] = [[start_x, start_y]]
    distance: List[List[int]] = [[0 for _ in range(len(maze[0]))] for _ in range(len(maze))]
    distance[start_x][start_y] = 1
    while len(stack)!= 0:
        # Pop the current position.
        current_x, current_y = stack[-1][0], stack[-1][1]
        # If the current position is the exit, return the distance.
        if maze[current_x][current_y] == "0":
            return str(distance[current_x][current_y] - 1)
        # Check if the current position is blocked.
        if maze[current_x][current_y] == "1":
            stack.pop()
            continue
        # Loop through all possible paths from the current position.
        for path in [(-1, 0), (0, 1), (1, 0), (0, -1)]:
            next_x, next_y = current_x + path[0], current_y + path[1]
            # Check if the position is within the maze.
            if 0 <= next_x < len(maze) and 0 <= next_y < len(maze[0]):
                # Check if the path is safe.
                if maze[next_x][next_y] == "0" or maze[next_x][next_y] == "S":
                    # Check if the path is blocked.
                    if maze[next_x][next_y] == "1":
                        maze[next_x][next_y] = maze[current_x][current_y] + "U"
                    # Add the position to the stack.
                    stack.append([next_x, next_y])
                    # Add the distance to the distance array.
                    distance[next_x][next_y] = distance[current_x][current_y] + 1
        # Remove the current position from the stack.
        stack.pop()
    return "NOT POSSIBLE"

