def solution(stdin: str) -> str:
    # write your code in Python 3.6
    matrix = stdin.split('\n')
    l, m = len(matrix), len(matrix[0])
    def get_dist(x1: int, y1: int, x2: int, y2: int) -> int:
        return abs(x1-x2) + abs(y1-y2)
    def get_neighbours(x: int, y: int) -> list:
        return [[x+1,y],[x-1,y],[x,y+1],[x,y-1]]
    visited = set()
    def dfs(x: int, y: int, dist: int) -> int:
        if x >= l or x < 0 or y >= m or y < 0:
            return
        if matrix[x][y] == 'H':
            return dist
        if (x,y) not in visited:
            visited.add((x,y))
            for i in get_neighbours(x,y):
                res = dfs(i[0], i[1], dist + get_dist(x,y,i[0],i[1]))
                if res!= None:
                    return res
    return dfs(l-1,0,0)

