        for i in range(5):
            for j in range(i + 1, 5):
                if table[i][j] == table[j][i]:
                    table[i][j] = "X"
        return [[j for j in i] for i in table]

    key = stdin
    plain = stdin.replace(" ", "")
    e = encode(key, plain)
