def solution(stdin: str) -> str:
    def split_events(event: str) -> (int, int, int, int):
        """Returns a tuple of the following form:
        - the number of new shares for each share split
        - the number of new shares for each share merged
        - the number of shares sold
        - the number of shares that died
        """
        operation, *values = event.split()
        if operation == "buy":
            return 0, int(values[0]), int(values[1]), 0
        elif operation == "sell":
            return int(values[0]), 0, int(values[1]), 0
        elif operation == "split":
            return int(values[0]), 0, 0, 0
        elif operation == "merge":
            return 0, int(values[0]), 0, 0
        elif operation == "die":
            return 0, 0, 0, int(values[0])
        else:
            raise ValueError(operation)

    events = [e.split(" ") for e in stdin.split("\n")[:-1]]
    events = [e for e in events if len(e) == 4]
    events = [split_events(e) for e in events]
    events = sorted(events, key=lambda e: e[2] - e[0], reverse=True)

    total_cost = 0
    for _, _, sold, died in events:
        total_cost += sold - died
        total_cost *= (1 + 0.3)

    return "{:.2f}".format(total_cost)

