    def is_ball(c):
        return c == 'A' or c == 'B' or c == 'C'

    string = stdin.strip()
    n = len(string)
    assert n > 0

    index = 0
    while index < n:
        assert is_ball(string[index])

        index += 1

    if is_ball(string[0]):
        return '1'
    if is_ball(string[index % n]):
        return '3'
    if is_ball(string[(index + 1) % n]):
        return '2'
    return 'Invalid'

